function calcularPuntaje() {
    let puntaje = 0;

    // Obtener todas las preguntas
    const preguntas = document.querySelectorAll('.question');
    
    // Iterar sobre las preguntas y sumar los puntos de la respuesta seleccionada
    preguntas.forEach((pregunta, index) => {
        const seleccionada = document.querySelector(`input[name="q${index + 1}"]:checked`);
        if (seleccionada) {
            puntaje += parseInt(seleccionada.value);
        }
    });

    // Mostrar el resultado en la segunda pantalla
    document.getElementById('quiz-container').classList.add('hidden');
    document.getElementById('result-screen').classList.remove('hidden');

    const resultadoText = document.getElementById('resultado');
    const resultadoImagen = document.getElementById('resultado-imagen');

    resultadoText.textContent = `Tu puntaje es: ${puntaje}`;
    
    // Mostrar imagen de carita segÃºn el puntaje
    if (puntaje >= 50) {
        resultadoImagen.src = 'data:image/jpeg;base64,';
    } else {
        resultadoImagen.src = 'data:image/jpeg;base64,';
    }
}
